import React, { Component } from 'react';

class List extends Component {
  constructor(props) {
    super(props);
   
    this.state = {
        data: ["1","2"],
      };
}
componentWillMount(){
  var results = this.props.data;
            var data2 = [], item;
            for (var i = 0, len = results.length; i < len; i++) {
                item = results[i];
                data2.push({id: item.id, title: item.title});
            }
            //var data = JSON.parse(this.props.data);
            //this.setState({data});
}
  render() {
      //works for array
   
      var li =this.state.data.map(function(item, i){
        console.log('test');
        return <li key={i}>{item}</li>
      })

      //doesn't work for array of objects
      

      return (
          <ul>
              
              {li}
             
             
          </ul>
      )
  }
}

export default List;
